import React from 'react';
import sdata from './Sdata';
import Card from './Card';

function Ncard (val){
    return (<Card 
        key={val.id} 
            src={val.src}
            title={val.title}
            details={val.details}
            Link={val}
        />);
}
const App = () => {
    return(<>
    
{sdata.map(Ncard)}
    </>);
}

export default App;
